import DepenseItem from "./components/DepenseItem";

function App() {
  const depenses = [
    {
      id: 'e1',
      titre: 'Assurance voiture', 
      montant: 107.5, 
      date: new Date(2022, 2, 28)
    },
    {
      id: 'e2',
      titre: 'Frais vétérinaire', 
      montant: 355.7, 
      date: new Date(2021, 9, 15)
    },
    {
      id: 'e3',
      titre: 'Chauffage', 
      montant: 87.9, 
      date: new Date(2020, 11, 5)
    },
    {
      id: 'e4',
      titre: 'Nourriture', 
      montant: 200.46, 
      date: new Date(2020, 6, 16)
    },
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <DepenseItem titre={depenses[0].titre} montant={depenses[0].montant} date={depenses[0].date}/>
      <DepenseItem titre={depenses[1].titre} montant={depenses[1].montant} date={depenses[1].date}/>
      <DepenseItem titre={depenses[2].titre} montant={depenses[2].montant} date={depenses[2].date}/>
      <DepenseItem titre={depenses[3].titre} montant={depenses[3].montant} date={depenses[3].date}/>
    </div>
  );
}

export default App;
